    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
    grid-gap: 2rem;
`


export default function SignInPage() {
    return (
        <GridStyles>
            <SignIn />
            <SignUp />
            <RequestReset />
        </GridStyles>
    )
}
